import React, { useState } from "react";
import "./posting.css";
import { FaCalendarAlt, FaClock } from "react-icons/fa";
import { useNavigate } from "react-router-dom";

const EventPost = () => {
  const [eventName, setEventName] = useState("");
  const [date, setDate] = useState("2023-05-15");
  const [time, setTime] = useState("14:00");
  const [duration, setDuration] = useState("3h 45m");
  const [location, setLocation] = useState("");
  const [guests, setGuests] = useState(["user1@example.com", "user2@example.com"]);

  return (
    <div className="event-container">
      <div className="event-box">
        <h2>Create Event</h2>

        <label>Event name</label>
        <input
          type="text"
          placeholder="Enter event name"
          value={eventName}
          onChange={(e) => setEventName(e.target.value)}
        />
        <button className="description-btn">Add description</button>

        <div className="event-details">
          <div className="date-time">
            <label>Date</label>
            <div className="input-with-icon">
              <FaCalendarAlt />
              <input
                type="date"
                value={date}
                onChange={(e) => setDate(e.target.value)}
              />
            </div>
          </div>

          <div className="date-time">
            <label>Time</label>
            <div className="input-with-icon">
              <FaClock />
              <input
                type="time"
                value={time}
                onChange={(e) => setTime(e.target.value)}
              />
            </div>
          </div>

          <div className="duration">
            <label>Duration</label>
            <select value={duration} onChange={(e) => setDuration(e.target.value)}>
              <option>3h 45m</option>
              <option>1h</option>
              <option>2h</option>
              <option>3h</option>
              <option>4h</option>
            </select>
          </div>
        </div>

        <label>Location</label>
        <div className="location-box">
          <input
            type="text"
            placeholder="Choose Location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
          />
          <button className="meeting-room-btn">Set meeting room</button>
        </div>

        <label>Add guests</label>
        <div className="guest-box">
          <input type="email" placeholder="contact@example.com" />
          <button className="add-btn">Add</button>
        </div>

        <div className="guest-list">
          {guests.map((guest, index) => (
            <div key={index} className="guest-avatar">
              <span>{guest[0].toUpperCase()}</span>
            </div>
          ))}
          <div className="guest-avatar more">+3</div>
        </div>
      </div>
    </div>
  );
};

export default EventPost;
